css:
@-moz-document domain("gratisjuegos.org"), domain("gratisprogramas.org"), domain("gratismusica.org"), domain("gratispeliculas.org") {
body {
font: 12px Arial, Helvetica, Verdana, sans-serif;
color: #BEBEBE;
background: #000 url("http://d36xtkk24g8jdx.cloudfront.net/bluebar/3a30db9/images/shared/noise-2.png")!important;
text-align: center;
margin: 0;
padding: 0;
}
#content {
margin: 10px 0;
padding: 0;
width: 770px;
float: left;
border: 1px solid #FFFFFF;
background: rgba(248, 248, 248, 0.2);
}
#content1 {
margin: 0px 0;
font: 13px Arial, Helvetica, sans-serif;
padding: 0;
width: 754px;
background: rgba(0,0,0,0);
}

.dbx-content {
margin: 0;
padding: 0 10px;
background-color: rgba(248, 248, 248, 0.2);
overflow: hidden;
}
.dbx-content {
margin: 0;
padding: 0 10px;
/* background: url(http://descargarlo.net/img/sidep-bottom.gif) no-repeat; */
overflow: hidden;
}.dbx-content {
	margin: 0;
	padding:0 10px;
	background: rgba(248, 248, 248, 0.2) url("http://d36xtkk24g8jdx.cloudfront.net/bluebar/3a30db9/images/shared/noise-2.png");
	overflow: hidden;
}
/* toggle state of inner content area */
.dbx-box-closed .dbx-content {
	display:block;
	height:0;
	padding:0;
	overflow:hidden;
	border-bottom:1px solid #FFFFFF;
}
.dbx-box-closed .dbx-content * {
	display:none;
}

a, a:visited {
color: #0080FF;
text-decoration: none;
}

.gsc-control-cse {
font-family: Arial, sans-serif;
border-color: #F8F8F8;
background-color: rgba(248, 248, 248, 0);
}
.cse .gsc-control-cse, .gsc-control-cse {
/* background-color: #F90808; */
border: 0px solid #ffffff;
}
.gsc-webResult.gsc-result, .gsc-results .gsc-imageResult {
border-color: #F8F8F8;
background-color: rgba(0, 0, 0, 0);
}
}
